import style from "./Card.module.css"
const Card = (props) => {
    return (
        <>
            <h3><i className="fa-solid fa-city"></i><span className={style.city}>{props.data.city}</span></h3>
            <h3 className={style.date}>
                {props.day},{props.date}{props.month},{props.year}
            </h3>
            <div className={style.hum}>
                <h3><i class="fa-solid fa-cloud"></i> humidity</h3>
                <h3>Temp</h3>
            </div>
    
        </>
    )
}
export default Card;
